import React from "react";
import Nav from "../components/Navbar/Navbar";

function BeInTouch() {
  return (
    <div>
      <Nav />
      <h1>
        Thank you for applying for a consultation call. We will be in touch
        shortly.
      </h1>
    </div>
  );
}

export default BeInTouch;
